  const [bad, setBad] = useState(0)

  return (
    <div>
      <h2>Give feedback</h2>
      <button>good</button>
      <button>neutral</button>
      <button>bad</button>
      <h2>Statistics</h2>
      <span>good</span>
      <p>neutral</p>
